import React from'react';



const Footer = () =>(

    <div className="footer">
            <ul>
                <li><p>Made With: </p></li>
                <li><img src="../img/weather.png" alt="Smiley face" height="20" width="20"></img></li>
                <li><img src="../img/google.png" alt="Smiley face" height="20" width="20"></img></li>
            </ul>
    </div>

);



export default Footer;
